import React from 'react'
import { Button, Item, Icon, Image, Label } from 'semantic-ui-react';
import "semantic-ui-css"
const EnterpCard = (props) => {
    console.log(props)
    return (
        <Item style={{marginLeft:"25vw"}}>
            <Item.Image size='tiny' src={props.img} />
            {/* <Label>{props.content}</Label> */}
            <Item.Content style={{marginLeft:"2vw"}} verticalAlign="middle">
                <Item.Header>{props.content}</Item.Header>
                <Button>Watch And Update
            <Icon name='right chevron' />
                </Button>
            </Item.Content>
        </Item>
    )
}

export default EnterpCard
